import React from 'react'
import { Parallax } from 'react-scroll-parallax'

class ParallaxTest extends React.Component {
  render () {
    return (
      <div>

        <Parallax className='work-image--bg' y={[-80, 80]} tagOuter='figure'>
          <img src='/assets/img/urb-reception.jpg' alt='placeholder' />
        </Parallax>
        <Parallax className='work-image--fg' y={[-40, 40]} tagOuter='figure'>
          <img src='/assets/img/urb-reception.jpg' alt='placeholder' />
        </Parallax>
      </div>
    )
  }
}
export default ParallaxTest
